  input: 'TEXT,F3XN,,"First, (Schedule B: Allocation of Expenses) the NJSLPAC / LPL
    is registered as both a federal and non-federal state PAC. The federal PAC acts
    as the collecting entity, which then periodically transfers monies to our affiliated
    organization (LPL) and to our non-federal state PAC. Accordingly, all federal
    expenses are paid by the connected organization and all non-federal expenses are
    paid by the non-federal PAC. All federal activity is conducted from the federal
    account and none of the transfers to the non-federal PAC were reimbursements for
    federal activities. Second, (Line (a)(ii) Unitemized Receipts) according to this
    Quarterly Report (07/01/06 - 09/30/06) this Committee discloses $470,833.03 in
